import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from "react-router-dom";
import { FaSearch } from "react-icons/fa";
import logo from "./assets/sooraj-logo.PNG";
import Home from "./pages/Home";
import About from "./pages/About";
import Contact from "./pages/Contact";
import FAQs from "./pages/Faqs";
import Products from "./pages/Products";
import Footer from "./components/Footer";
import "./App.css";

function App() {
  const [isOpen, setIsOpen] = useState(false);
  const [search, setSearch] = useState("");

  return (
    <Router>
      <Header isOpen={isOpen} setIsOpen={setIsOpen} search={search} setSearch={setSearch} />

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/Products" element={<Products />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/FAQs" element={<FAQs />} />
      </Routes>

      <Footer />
    </Router>
  );
}

// ‚úÖ Header component for cleaner structure
function Header({ isOpen, setIsOpen, search, setSearch }) {
  const location = useLocation();

  return (
    <header
      className="header"
      style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "18px 60px",
        backgroundColor: "#fff",
        boxShadow: "0 2px 8px rgba(0,0,0,0.08)",
        position: "sticky",
        top: 0,
        zIndex: 1000,
      }}
    >
      {/* Left: Logo and Title */}
      <div
        className="logo-section"
        style={{ display: "flex", alignItems: "center", gap: "12px" }}
      >
        <img
          src={logo}
          alt="Sooraj Logo"
          className="logo"
          style={{ height: "48px", objectFit: "contain" }}
        />
        <h1
          className="site-title"
          style={{
            color: "#127a3a",
            fontSize: "1.4rem",
            fontWeight: "700",
            letterSpacing: "1px",
          }}
        >
          Sooraj Crop Sciences
        </h1>
      </div>

      {/* Right: Navigation Links */}
      <nav
        className="nav-links"
        style={{
          display: "flex",
          alignItems: "center",
          gap: "34px",
          fontSize: "1.1rem",
          fontWeight: "600",
        }}
      >
        {["Home", "About", "Products", "Contact", "FAQs"].map((page) => {
          const path = page === "Home" ? "/" : `/${page.toLowerCase()}`;
          const active = location.pathname === path;
          return (
            <Link
              key={page}
              to={path}
              className="nav-link"
              style={{
                textDecoration: "none",
                color: active ? "#127a3a" : "#444",
                paddingBottom: "4px",
                borderBottom: active ? "2px solid #127a3a" : "2px solid transparent",
                transition: "all 0.3s ease",
              }}
            >
              {page}
            </Link>
          );
        })}

        {/* üîç Search Icon and Expandable Input */}
        <div style={{ display: "flex", alignItems: "center", position: "relative" }}>
          <div
            onClick={() => setIsOpen((prev) => !prev)}
            style={{
              backgroundColor: "#127a3a",
              color: "white",
              padding: "10px",
              borderRadius: "50%",
              cursor: "pointer",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              transition: "transform 0.2s ease",
            }}
            title="Search products"
          >
            <FaSearch size={16} />
          </div>

          <input
            type="text"
            value={search}
            onChange={(e) => setSearch(e.target.value)}
            placeholder="Search products..."
            style={{
              padding: "8px 12px",
              width: isOpen ? "220px" : "0px",
              opacity: isOpen ? 1 : 0,
              border: isOpen ? "1px solid #ccc" : "none",
              borderRadius: "6px",
              outline: "none",
              marginLeft: "8px",
              transition: "all 0.4s ease",
              fontSize: "0.95rem",
            }}
          />
        </div>
      </nav>
    </header>
  );
}

export default App;
